import React from 'react'
import { NavLink } from 'react-router-dom'

export const Navbar = () => {
  return (
    <nav>
        <NavLink style={navLinkStyles} to='/'>Home</NavLink>
        <NavLink to='/about'>About</NavLink>
    </nav>
  )
}
